    true,nt"url": null,nt"notes": "The One VA Enterprise Architecture (OneVA
    EA) is a comprehensive picture of the Department of Veterans Affairs' (VA) operations,
    capabilities and services and the business processes and IT capabilities that support
    them. The VA's architecture is an evolving entity built through ongoing collaboration
    between business and technology leaders and staff across the administration. As
    the organization evolves and strives to meet change, its architectural picture changes.
    rnThe Department of Veterans Affairs VA Technical Reference Model (One-VA TRM) is
    one component within the overall EA that establishes a common vocabulary and structure
    for describing the information technology used to develop, operate, and maintain
    enterprise applications. Moreover, the One-VA TRM, which includes the Standards
    Profile and Product List, serves as a technology roadmap and tool for supporting
